import React, { Component } from 'react';
import './App.css';
import Leafmap from './map'
import axios from 'axios';

class App extends Component {
	state = {
		commaData: []
	}
  componentDidMount () {
  	axios.get('http://localhost:8080/api/comma-data')
      .then( (data) => {
      	this.setState( {
      		commaData: data
      	})
      })
  }
  render() {
    return (
      <div className="App">
        <Leafmap data={this.state.commaData}/>
      </div>
    );
  }
}

export default App;
